/** Sole constructor. */
public BitSetIterator(BitSet bits, long cost) {
  this.bits = bits;
  this.length = bits.length();
  this.cost = cost;
}

/** Sole constructor. */
public BitSetIterator(BitSet bits, long cost) {
  if (cost < 0) {
    throw new IllegalArgumentException("cost must be >= 0, got " + cost);
  }
  this.bits = bits;
  this.length = bits.length();
  this.cost = cost;
}

